const tasks = [
    {
        id : 1,
        text : 'Doctors Appointment',
        day : 'Feb 5th at 2.30pm',
        reminder : true,
    },

    {
        id : 2,
        text : 'Meeting at School',
        day : 'Feb 4th at 1.30pm',
        reminder : true,
    }
]

const Tasks = function()
{
    return(
        <>
            {
                tasks.map(
                    (tasks) => (
                        <h3 key = {tasks.id}>
                            {tasks.text}
                        </h3>
                    )
                )
            }
        </>
    )
}

export default Tasks
